const Button1 = ({
  variants = "primary",
  size = "medium",
  children,
  type = "button",
  style,
  onClick,
  label,
  icon,
  iconName,
}) => {
  return (
    <>
      <button
        {...children}
        type={type}
        style={style}
        onClick={onClick}
        className={`btn btn-${variants} btn-${size}`}
      >
        {icon && `<img src=${icon} alt="${iconName}" />`}
        <span>
          {label && label} {children}
        </span>
      </button>
    </>
  );
};

export default Button1;
